import { createRouter,createWebHistory } from "vue-router";
import home from '../homes/Home.vue'


const routen=[
  { path :"/listem" , component : ()=>import("@/components/listem/listes.vue")},
  {
    path: '/home',
    name: 'Home', 
    component :home}

]

export default()=> createRouter({history:createWebHistory(),
    routen
})
